import '../App.css'
import '../bootstrap.min.css'
import React, { useState } from "react";

function Planet(props) {
    return (

            <model-viewer
                src={props.image}
                alt="A rock"
                exposure="1.5"
                disable-tap
                auto-rotate
                camera-controls
                touch-action="pan-y"
                disable-zoom
                style={{height: '400px', position:"relative"}}

            >
            </model-viewer>
    );
}

export default Planet
